package com.hasmobi.rambo.lib;

public class DException extends Exception {

	/**
	 * auto-generated, related to serialization uniqueness
	 */
	private static final long serialVersionUID = -8603191675545526585L;

	public DException() {
		super();
	}

	public DException(String detailMessage, Throwable throwable) {
		super(detailMessage, throwable);
	}

	public DException(String detailMessage) {
		super(detailMessage);
	}

	public DException(Throwable throwable) {
		super(throwable);
	}

	

}
